import "./animations.css";

export default function Projects() {
  return (
    <section className="container py-5 slide-up">
      <h2>Projects</h2>
      <ul>
        <li>Pharmacy Recommendation System</li>
        <li>E-Commerce Platform</li>
        <li>Modern Portfolio Website</li>
      </ul>
    </section>
  );
}
